class Box(object):
    def __init__(self, selector):
        self.selector = selector

    def do_action(self, value, submit=False, clear=True):
        self.obj = driver.find_element_by_css_selector(self.selector)
        if clear:
            self.obj.clear()
        self.obj.send_keys(value)
        if submit:
            self.obj.submit()

    def exists(self):
        return len(driver.find_elements_by_css_selector(self.selector)) > 0

    def is_visible(self):
        if not self.exists():
            return False

        return driver.find_element_by_css_selector(self.selector).is_displayed()

class Button(object):
    def __init__(self, selector):
        self.selector = selector

    def do_action(self) -> object:
        '''finds element and left clicks. Returns True if it finds an element to click on, False if not.

        :return: True or False
        '''
        try:
            self.obj = driver.find_element_by_css_selector(self.selector)
            self.obj.click()
            return True
        except NoSuchElementException:
            return False

    def exists(self) -> object:
        if driver.find_elements_by_css_selector(self.selector):
            return True
        else:
            return False

    def is_visible(self):
        if not self.exists():
            return False

        return driver.find_element_by_css_selector(self.selector).is_displayed()

    def text(self):
        if not driver.find_elements_by_css_selector(self.selector):
            return False
        else:
            return driver.find_element_by_css_selector(self.selector).text

    #for debugging purposes. should probably check if element exists first.
    def web_element(self) -> object:
        return driver.find_element_by_css_selector(self.selector)


class Screen(object):

    def __init__(self, selector, screen_name, exact_match=True):
        self.selector = selector
        self.screen_name = screen_name
        self.exact_match = exact_match

    def is_active(self):
        self.objs = driver.find_elements_by_css_selector(self.selector)
        return len(self.objs) > 0 # If the css selector is found, return True

    def exists(self):
        if not self.existz():
            return False

        try:
            element_text = driver.find_element_by_css_selector(self.selector).text
        except StaleElementReferenceException:
            return False

        print('self.screen_name is:', self.screen_name)
        print('the elements text is:', element_text)
        print('exact_match is:', self.exact_match)

        if self.exact_match:
            return self.screen_name == element_text
        else:
            return self.screen_name in element_text

    def existz(self) -> object:
        return len(driver.find_elements_by_css_selector(self.selector)) > 0

    def is_visible(self):
        if not self.existz():
            return False

        try:
            return driver.find_element_by_css_selector(self.selector).is_displayed()
        except StaleElementReferenceException:
            return False

def convert_string(string):
    string = string.replace('%20', ' ')
    string = string.replace('%2B', '+')
    string = string.replace('%26', '&')
    string = string.replace('%27', '\'')
    string = string.replace('%E2%85%93', '?')
    string = string.replace('%E2%85%94', '?')
    string = string.replace('&amp;', '&')
    return string

def sleep_until(boolean_method, until_bool=True, Args=False, max_time=10, interval=200, interval_rand=100, max_time_rand=2, debug=True):
    ''' sleeps for interval times [in ms] until the boolean method is true or max time [in seconds] has been reached.
    Returns true if the boolean method is true before max time is reached. False if max time is reached.

    :param boolean_method:  method. a method that returns True or False
    :param until_bool:      boolean. what we're looking for boolean_method to return
    :param Args:            string. The arguments passed to the boolean_method.
    :param max_time:        integer. seconds. the maximum amount of time to sleep for
    :param interval:        integer. milliseconds. the intervals to sleep for
    :param interval_rand:   integer. milliseconds. a random number (between 0 and this) is added to the sleep interval
    :param max_time_rand:   integer. seconds. a random number (between 0 and this) is added to the max_time
    :param debug:           boolean. If true, it will use print() to write some debugging info.
    :return:
    '''

    max_timer = max_time + randint(0, max_time_rand) + time()   #seconds
    interval = (interval + randint(0, interval_rand))/1000      #milliseconds

    #option 1
    '''using time()'''
    while time() < max_timer:
        sleep(interval)
        if Args:
            method_result = boolean_method(Args)
        else:
            method_result = boolean_method()
        if method_result == until_bool:
            if debug:
                print('Found:', boolean_method.__qualname__)
            return True

    if debug:
        print('Failed to find', boolean_method.__qualname__, 'in time:', max_time, 'seconds')
    return False

    #option 2
    #'''does not need to call time() but can potentially be more greatly affected by processing times'''
    #max_time = max_time + randint(0, max_time_rand)
    #interval = (interval + randint(0, interval_rand))/1000
    #max_intervals = round(max_time / interval)

    #for i in range(max_intervals):
    #    sleep(interval)
    #    if boolean_method() == until_bool:
    #        return True
    #return False

def setup_browser():
    global driver

    if try_to_reconnect:
        try:
            url_file = open(url_file_location)
            old_url = url_file.read()
            # print(old_url)
            url_file.close()
        except:
            old_url = ''

        try:
            session_file = open(session_file_location)
            old_session_id = session_file.read()
            # print(old_session_id)
            session_file.close()
        except:
            old_session_id = ''

        create_new_browser = False

        if (old_session_id == '') or (old_url == ''):
            # print('at least one file is empty so we are creating a new browser')
            create_new_browser = True
        else:
            # print('both files have data so we are going to try to connect to an existing browser with that data')
            try:
                driver = webdriver.Remote(command_executor=old_url, desired_capabilities={})
                driver.close()
                driver.session_id = old_session_id
            except:
                # print('failed to connect to an old browser so we are creating a new browser')
                create_new_browser = True

        if create_new_browser:
            driver = webdriver.Chrome(executable_path=chrome_driver_location)
    else:
        driver = webdriver.Chrome(executable_path=chrome_driver_location)


def save_browser_info():
    global driver  # not technically needed but I feel like it might help readability.. *shrugs*

    url_file = open(url_file_location, 'w')
    url_file.write(driver.command_executor._url)
    url_file.close()

    session_file = open(session_file_location, 'w')
    session_file.write(driver.session_id)
    session_file.close()


