def get_css_selector(css_selector):
    try:
        return driver.find_element_by_css_selector(css_selector)
    except NoSuchElementException:
        pass

def text_css_selector(css_selector):
    '''
     1 -1 = not found.
     2 empty = found but with no text inside
     3 the text inside
     example output: 55 / 103
     example output: -1
     '''
    try:
        return driver.find_element_by_css_selector(css_selector).text
    except NoSuchElementException:
        return '-1'

