def offer(slot, buy_or_sell, item_name, amount, price):
    '''

    :param slot:        integer. -1 means first available slot. otherwise it should be 1-8
    :param buy_or_sell: string. 'buy' or 'sell'
    :param item_name:   string. the item to search for
    :param amount:      integer. amount of item to buy/sell. -1 means as many as possible
    :param price:       integer. price to buy/sell item at.
    :return:            boolean. True if successfully offered item, False if it messed up somewhere.
                        Could return error codes instead. e.g. returning 1 means slot error, 2 means buy_or_sell error,
                        3 means item name_error, 4 amount error, etc
    '''

    if not return_home():
        return False

    available_slots = list_available_ge_slots()

    if not available_slots:
        print('there is not a single available ge slot at this time')
        return False

    if slot == -1:
        slot = available_slots[0]
    elif 1 <= slot <= 8:
        if slot not in available_slots:
            print('the slot:', slot, 'was not in the list of available ge slots:', available_slots)
            return False
    else:
        print('slot must be a number 1 to 8. -1 means first available slot')
        return False

    if buy_or_sell == 'buy':
        buy_buttons[slot].do_action()
        if not sleep_until(screen_GE_Buy.exists):
            return False

        get_css_selector('#search').send_keys(item_name) #refactor plz #done! see: box_search_items  box_search_items.exists -wait-> box_search_item.do_action(item_name)

        if not sleep_until(screen_previous_completed.exists):
            return False

        if not sleep_until(button_spinner.exists, False):
            return False

        print('refactoring')
        #first_buy_result_title = get_css_selector('body > div.sliding-wrapper > div.ng-scope > section > div.content.push-top-double.push-bottom-tiny.ng-scope > ul > li:nth-child(1) > a > div.details > h2') #refactor
        #if first_buy_result_title.text != item_name:
        #    print('input item name of:', item_name, 'is different from the first result item name of:', first_buy_result_title.text)
        #    return False

        if not button_buy_only_result.exists():
            return False

        button_buy_only_result.do_action()

        if not sleep_until(box_enter_quantity_buy.exists):
            return False

        box_enter_quantity_buy.do_action(amount, True)

    elif buy_or_sell == 'sell':
        sell_buttons[slot].do_action()
        if not sleep_until(screen_GE_Sell.exists):
            return False

        get_css_selector('#search').send_keys(item_name)  # refactor, already done in price_check()

        if not sleep_until(button_sell_only_result.exists):
            return False

        sleep(0.5) #incase item cant be clicked right away... refactor, maybe.

        button_sell_only_result.do_action()

        if not sleep_until(button_confirm_sell.exists):
            return False

        button_confirm_sell.do_action()

