def get_reg_buy_price(buy_text):
    reg_price_buy = buy_text

    print('reg_price_buy is:', reg_price_buy)
    if not reg_price_buy:
        print('failed to find reg_price_buy')
        return False

    reg_price_buy = reg_price_buy[:reg_price_buy.find('gp') - 1]
    if reg_price_buy.find('k') > -1:
        reg_price_buy = reg_price_buy.replace('k', '')
        multiply_by = 1000
    elif reg_price_buy.find('m') > -1:
        reg_price_buy = reg_price_buy.replace('m', '')
        multiply_by = 1000000
    else:
        multiply_by = 1

    reg_price_buy = reg_price_buy.replace(',', '')

    try:
        reg_price_buy = int(float(reg_price_buy) * multiply_by)
    except ValueError:
        print('error doing float stuff to reg_price_buy')
        return False

    print('new reg buy price is:', reg_price_buy)

    return reg_price_buy

def get_reg_sell_price(text):
    if not sleep_until(button_sell_price.is_visible):
        print('failed to find button_sell_price on screen')
        return False

    reg_price_sell = text
    print('reg_price_sell is:', reg_price_sell)
    if not reg_price_sell:
        print('failed to find reg_price_sell')
        return False

    #reg_price_sell = reg_price_sell[reg_price_sell.find('Total value: ') + 13:]
    if 'gp each' in reg_price_sell:
        reg_price_sell = reg_price_sell[:reg_price_sell.find('gp each') - 1]
        reg_price_sell = reg_price_sell[reg_price_sell.find('(') + 1:]
    else:
        reg_price_sell = only_numerics(reg_price_sell)


    reg_price_sell = reg_price_sell.replace(',', '')
    print('new reg_price_sell is:', reg_price_sell)

    if reg_price_sell == -1 or not reg_price_sell.isdigit():
        return False

    return reg_price_sell

