def price_check(item_name, slot=-1):
    global reg_price_buy
    global reg_price_sell

    if not return_home():
        return False

    if not open_buy(item_name, slot):
        return False

    print('get_coins is:', get_coins())

    coins_number = get_coins()
    price_to_pay = round(int(reg_price_buy) * ib_multiplier)

    if (price_to_pay - reg_price_buy) > (max_loss):
        print('old price to pay is:', price_to_pay)
        print('price_to_pay - reg_price_buy is > max_loss!', price_to_pay - reg_price_buy, '&', max_loss, 'respectively')
        price_to_pay = reg_price_buy + (max_loss)
        print('new price to pay is:', price_to_pay)

    if price_to_pay > max_cash:
        price_to_pay = max_cash
    if price_to_pay > coins_number:
        if try_with_cash_stack:
            price_to_pay = coins_number
        else:
            print('cash stack of:', coins_number, 'was not enough for price_to_pay of:', price_to_pay)
            return False

    price_to_pay = str(price_to_pay)

    if not buy(1, price_to_pay):
        return False

    instant_buy_price = get_price()
    if int(instant_buy_price) < 1:
        abort()
        collect_items()
        return 'Aborted Buying'

    collect_items()

    #False gets converted to 0
    reg_sell_price = int(open_sell(item_name, slot))
    if not reg_sell_price:
        return False

    sell_price = round(reg_sell_price * is_multiplier)

    if reg_sell_price - sell_price > max_loss:
        print('maximum loss per is too high, we would be selling at a loss of:', reg_sell_price - sell_price)
        sell_price = reg_sell_price - max_loss
        print('lets sell for', sell_price, 'instead')

    #max_cash test for selling
    if sell_price < 1:
        raise ValueError('why is sell_price less than 1?? fix this')

    print('sell price is:', sell_price)

    #this used to be reg_price_sell instead of sell_price
    if not sell(1, sell_price):
        return False

    instant_sell_price = get_price()
    if int(instant_sell_price) < 1:
        abort()
        return 'Aborted Selling'

    if not collect_items():
        return False

    print('ib:', instant_buy_price, 'reg buy price:', reg_price_buy)
    print('is:', instant_sell_price, 'reg sell price:', reg_price_sell)
    print('raw margin is:', int(instant_buy_price) - int(instant_sell_price))

    return [item_name, instant_sell_price, str(int(instant_buy_price) - int(instant_sell_price)), item_master_dict[item_name][2]]

